import React from 'react';
import './SolutionPage.css';

function Plumbing() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">Plumbing</h1>
      <div className="solution-desc">Rosie ensures plumbing businesses never miss emergency calls and can quickly respond to customer needs, day or night.</div>
      <div className="solution-section">
        <h2>Why Plumbers Use Rosie</h2>
        <ul>
          <li>Emergency call handling 24/7</li>
          <li>Appointment scheduling and reminders</li>
          <li>Instant notifications for urgent jobs</li>
        </ul>
      </div>
    </div>
  );
}

export default Plumbing;
